import React, { Component } from "react";
import { BrowserRouter } from "react-router-dom";

//Importing components
import NavBar from "./components/layout/NavBar";

class App extends Component {
  render() {
    return (
      <div className="App">
        <BrowserRouter>
          <NavBar />
        </BrowserRouter>
      </div>
    );
  }
}

export default App;
